// 위치 문자 → ID
function moveToIndex(move) {
    let letter = move[0];  // 문자 (a~h)
    let number = move[1];  // 숫자 (1~8)

    return (letter.charCodeAt(0) - 'a'.charCodeAt(0)) * 8 + (parseInt(number, 10) - 1);
}

// 게임 로그 파싱
function parseGameMoves(logs) {
    let moves = [];
    let maxLength = 60;
    
    for (let i = 2; i < logs.length; i+=2) {
        let b = logs[i-1].split(": ");
        if (b.length < 2) moves.push(64);
        else moves.push(moveToIndex(b[1]));

        let w = logs[i].split(": ");        
        if (w.length < 2) moves.push(64);
        else moves.push(moveToIndex(w[1]));
    }
    return moves.slice(-maxLength);
}

// ID → row column
function indexToMove(index) {
    if (index < 0 || index > 63) return null; // 유효 범위 검사

    let letter = Math.floor(index / 8);
    let number = index % 8;

    return {"row":letter, "col":number};
}

// 앞쪽에 padding 추가
function padListFront(arr) {
    return Array(Math.max(0, 60 - arr.length)).fill(64).concat(arr);
}

